export default function CartProduct({ name, mainPicture, price, onCardClick, id }) {

  mainPicture = mainPicture.replace(/'/g, ''); // kolkhoz

  function handleClick() {
    onCardClick(id)
  }

  return (
    <li className='cart__product-card'>
      <img className='cart-product' src={mainPicture} onClick={handleClick}></img>
    </li>
  )
}
